import React from "react";
import {Droppable} from 'react-beautiful-dnd';

const Column = (props) => {
    return (
        <div>
            <Droppable droppableId={props.id}>
                {(provided) => <p>{props.title}</p>}
            </Droppable>
        </div>
    )


}

export default Column
